import React from "react";
import wallpaper from "../components/images/wallpaper.jpeg"
import './Home.css';

const Home = () => {

    return (
        <div className="homeContainer">
            <img src={wallpaper}  alt="Wallpaper" className="homeImage" />
            <div className="homeText">
                <h2 className="homeTextName">Woof-Woof</h2>
                <h3 className="homeTextTitle">Let's Just be friends fur-ever </h3>
            </div>
        </div>
    )
}

export default Home;
